import React from 'react'
import './Projects.css'

const Projects = () => {
  return (
    <div id='projects' className='ProjectsComponent'>
       <div className='wrapper4'>
          <h1>PROJECTS</h1>
          <h2> I have worked on a wide range of projects. Here are some of my projects.</h2>
       </div>
    </div>
  )
}

export default Projects
